import React, { Component } from 'react';
import './App.css';
import UserInput from './UserInput/UserInput';
import UserOutput from './UserOutput/UserOutput';

class App extends Component {
  state = {
    username: [
      { nick: 'p-arth'}
    ]
  };

  render() {
    return (
      <div className="App">
        <UserInput />
        <UserOutput
          name={this.state.username[0].nick} />
      </div>
    );
  }
}

export default App;
